    END,
    updatedat = NOW()
    WHERE symbol IN ('UYM', 'USMV', 'SHE', 'FMF', 'UYLD', 'GLRY', 'FTCS', 'EWZS', 'SPGM', 'PSCE', 'OARK', 'QAT', 'SPY', 'KRE', 'UTHY', 'OUSM', 'JUCY', 'FLCA', 'DFEV', 'DFSD');